$(document).konami({
    result: function () {
        var canvas = document.createElement("canvas");
        canvas.width = window.innerWidth;
        canvas.height = window.innerHeight;
        var ctx = canvas.getContext('2d');
        canvas.setAttribute('style', 'z-index: 50000; position: fixed; top: 0; left: 0; width: 100vw; height: 100vh; pointer-events: none;');
        $(canvas).appendTo("body");
        var i = 0;
        var interval = setInterval(function () {
            var w = canvas.width / 2;
            var h = canvas.height / 2;
            var r = h - (i / 8);
            var grd = ctx.createRadialGradient(w, h, 5, w, h, r);
            grd.addColorStop(0, "rgba(255, 215, 185, 0)");
            grd.addColorStop(0.25 * (r / h), "rgba(255, 215, 185, 0)");
            grd.addColorStop(((r - 2) / h), "rgba(255, 215, 185, 0.525)");
            grd.addColorStop(((r - 2) / h), "#222222");
            var x = Math.cos((i / 3) * Math.PI / 180) * r + w;
            var y = Math.sin((i / 3) * Math.PI / 180) * r + h;
            i++;
            ctx.strokeStyle = grd;
            ctx.lineWidth = 2;
            ctx.beginPath();
            ctx.moveTo(x, y);
            ctx.lineTo(w, h);
            ctx.stroke();
            ctx.closePath();
            if (r < 10) {
                clearInterval(interval);
            }
        }, 1);
    }
});

